	/**
	 * Verify that a new LinkedDnaStrand can be created. After it is created, it
	 * should have one node that contains the entire DNA sequence.
	 */
	@Test
	public void testNewDnaStrandSimple() {
		String dna = "ACGTACGT";
		LinkedDnaStrand linkedStrand = new LinkedDnaStrand(dna);

		assertEquals(dna, linkedStrand.getFirstNode().dnaSequence);
		assertEquals(1, linkedStrand.getNodeCount());

		totalScore += 2;
	}

	/**
	 * Verify that DNA sequences of varying lengths can be created.
	 */
	@Test
	public void testNewDnaStrand() {
		String[] dnaSequences = createRandomDnaSequences(10, 50, 100);

		for (String dnaSequence : dnaSequences) {
			LinkedDnaStrand linkedStrand = new LinkedDnaStrand(dnaSequence);
			SimpleDnaStrand simpleStrand = new SimpleDnaStrand(dnaSequence);

			assertEquals(simpleStrand.toString(), linkedStrand.toString());
			assertEquals(dnaSequence, linkedStrand.getFirstNode().dnaSequence);
			assertEquals(1, linkedStrand.getNodeCount());
		}

		totalScore += 5;
	}

	/**
	 * Verifies that LinkedDnaStrand properly appends DNA sequences as new
	 * nodes.
	 */
	@Test
	public void testAppend() {
		String dnaSequence = "GATTACA";
		LinkedDnaStrand linkedStrand = new LinkedDnaStrand(dnaSequence);

		String dnaToAppend = "CAT";
		linkedStrand.append(dnaToAppend);
		linkedStrand.append(dnaToAppend);

		// Verify that the string, # appends, and # of reported nodes are
		// correct
		assertEquals("GATTACACATCAT", linkedStrand.toString());
		assertEquals(2, linkedStrand.getAppendCount());
		assertEquals(3, linkedStrand.getNodeCount());

		// Verify that each node contains the correct DNA sequence
		DnaSequenceNode node = linkedStrand.getFirstNode();
		for (int nodeNdx = 0; nodeNdx < 3; nodeNdx++) {
			assertNotNull("There is no node at index " + nodeNdx, node);
			assertEquals("Sequences don't match at node index " + nodeNdx, nodeNdx == 0 ? dnaSequence : dnaToAppend,
					node.dnaSequence);
			node = node.next;
		}

		totalScore += 5;
	}

	/**
	 * Verify that DNA sequences of variable length can be appended a variable
	 * number of times.
	 */
	@Test
	public void testAppendRandom() {
		String dnaSequence = createRandomDnaSequence(50, 100);
		String dnaToAppend = createRandomDnaSequence(5, 10);
		int numTimesToAppend = (int) (random() * 10);
		LinkedDnaStrand linkedStrand = new LinkedDnaStrand(dnaSequence);
		SimpleDnaStrand simpleStrand = new SimpleDnaStrand(dnaSequence);

		for (int ndx = 0; ndx < numTimesToAppend; ndx++) {
			linkedStrand.append(dnaToAppend);
			simpleStrand.append(dnaToAppend);
		}

		assertEquals(simpleStrand.toString(), linkedStrand.toString());
		assertEquals(simpleStrand.getAppendCount(), linkedStrand.getAppendCount());
		assertEquals(numTimesToAppend + 1, linkedStrand.getNodeCount());

		// Verify that each node contains the correct DNA sequence
		DnaSequenceNode node = linkedStrand.getFirstNode();
		for (int nodeNdx = 0; nodeNdx < numTimesToAppend + 1; nodeNdx++) {
			assertNotNull("There is no node at position " + nodeNdx, node);
			assertEquals("Sequences don't match at position " + nodeNdx, nodeNdx == 0 ? dnaSequence : dnaToAppend,
					node.dnaSequence);
			node = node.next;
		}

		totalScore += 5;
	}

